import React, { Component } from 'react';
import axios from 'axios';
import Button from '@mui/material/Button';

class User extends Component {
    state = {
        users: [
            {
                address
                    :
                    "",
                birthday
                    :
                    "",
                createTime
                    :
                    null,
                email
                    :
                    "",
                id
                    :
                    1,
                isActive
                    :
                    false,
                password
                    :
                    "",
                phoneNumber
                    :
                    "",
                roleId: 0,
                updateTime: null
            }
        ]
    }

    async componentDidMount() {
        let res = await axios.get('http://localhost:8080/admin/user/allUser');
        this.setState({
            users: res.data
        })
    }

    render() {
        let listUser = this.state.users
        return (
            <>
                <div>
                    {
                        listUser.map((item, index) => {
                            return (
                                <div key={item.id}>
                                    {item.id}-{item.address}
                                </div>
                            )
                        })
                    }
                </div>
            </>
        );
    }
}

export default User;
